import React, { Component } from 'react';
import { connect } from 'react-redux';
import { getFavourites, getCapitals, addFavourite, GENERIC_ERROR } from '../actions';
import { Link } from 'react-router-dom';
import { FormLabel } from 'react-bootstrap';

class Home extends Component{
    constructor(props){
        super(props);
        
        this.state = {
            loading: true,
            defaultCapital: '',
            showError:false,
            errorMessage:''
        }
        
        this.props.getFavourites()
            .then(favouriteList => {
                if(favouriteList.type === GENERIC_ERROR){
                    this.handleError(favouriteList);
                }
                else{
                    console.log('favouriteList',favouriteList);
                    this.props.getCapitals()
                        .then(capitalList => {
                            if(capitalList.type === GENERIC_ERROR){
                                this.handleError(capitalList);
                            }
                            else{
                                console.log('capitalList',capitalList);
                                this.fetchAndAddDefaultCapital(capitalList.capitalsList);
                            }                            
                    });
                }
            })
        }

    handleError(res){
        if(res.err.errorCode === 99){
            this.setState({showError: true,
                            errorMessage:'Session Expired ! You will be redirected to Login page'
            });
            window.setTimeout(()=>{
                this.props.history.push(`/`);
            },3000);
        }
        else{
            this.setState({showError: true,
                            errorMessage:'An error occured. Please Try again!'
            });
        }
    }

    fetchAndAddDefaultCapital(capitalList){
        const url = `https://ip-api.com/json/`;
        return fetch(url,{
            method: "GET"
        }).then(response => response.json())
            .then(json => {
                if(json){
                    this.setState({loading: false,defaultCapital:capitalList[json.countryCode]});
                    this.props.addFavourite(capitalList[json.countryCode]);
                }
                else{
                    this.setState({showError: true,
                            errorMessage:'An error occured. Please Try again!'
                    });
                }                
            });
    }


    render(){
        return (
            <div>
                {
                    this.state.showError ? 
                        <FormLabel className="label-error label-error-weather">{this.state.errorMessage}</FormLabel>
                    :
                    <div></div>
                }
                <div className="home-container">
                    <ul className="favourite-city-list-group">
                        <li key={0} className="favourite-city-list-item">
                            <Link 
                                to={{pathname:"/weather",capital:this.state.defaultCapital}} 
                                onClick={() => localStorage.setItem('currentCapital',this.state.defaultCapital)}
                                >
                                    {this.state.defaultCapital}
                                </Link>
                        </li>
                        {
                            this.props.favouriteCityList.map((city,index) => {
                                if(city !== this.state.defaultCapital){
                                    return (
                                        <li key={index+1} className="favourite-city-list-item">
                                            <Link 
                                                to={{pathname:"/weather",capital:city}}
                                                onClick={() => localStorage.setItem('currentCapital',city)}
                                                >
                                                    {city}
                                                </Link>
                                        </li>
                                    )
                                }
                            })
                        }
                        {
                            !this.state.loading && 
                            <li className="favourite-city-list-item">
                                <Link to="/search">
                                    <img className="add-img" src='data:image/png;base64,'/>
                                </Link>
                            </li>
                        }
                    </ul>
                    {
                        this.state.loading &&
                            <img 
                                src="data:image/gif;base64," 
                                alt="Loading..."
                                className="loading-icon"
                                />
                    }
                </div>
            </div>
        )
    }
}

function mapStateToProps(state){
    return state;
}

export default connect(mapStateToProps,{ getFavourites, getCapitals, addFavourite })(Home);